  false,\n\t\"url\": null,\n\t\"notes\": \"Leafy spurge is considered an invasive
  species which displaces native vegetation in prairie habitats and fields. This data
  set portrays the county-level distribution of Euphorbia esula (common name - leafy
  spurge) in the United States of America. These data come from the U.S. Department
  of Agriculture (USDA) Natural Resources Conservation Service's PLANTS Database,
  which is the de facto Federal standard for information about the distribution and
  nomenclature of U.S. plants.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
